import { Routes, Route, BrowserRouter } from 'react-router-dom';
import { EuropeScreen } from '../components/Europe/EuropeScreen';
import { SpainScreen } from '../components/Spain/SpainScreen';
import { SearchScreen } from '../components/search/SearchScreen';
import { LoginScreen } from '../components/login/LoginScreen';

//Se van definiendo las rutas para acceder a las disitnas páginas de la aplicación:
export const AppRouter = () => {
    return(
        <BrowserRouter>
            <h1>Welcome to React Router!</h1>
            <Route>
                <Route path="/" element={<EuropeScreen />} />
                <Route path="/europe" element={<EuropeScreen />} />
                <Route path="/spain" element={<SpainScreen />} />
                <Route path="/search" element={<SearchScreen />} />
                <Route path="/login" element={<LoginScreen />} />
            </Route>
        </BrowserRouter>
    )
}
